    butterfly = n_wing - (n_head - spider)
    dragonfly = n_head - spider - butterfly
    if spider >= 0 and butterfly >= 0 and (dragonfly >= 0):
        return [spider, butterfly, dragonfly]
    else:
        return [-1, -1, -0]

